- **Contexto:**

# B.- Lineal Probability Model (LPM)

-  Preguntas de inter√©s:

  1) ¬øCu√°l es el efecto de la **edad** sobre la probabilidad de asistencia a museos de arte contempor√°neo en 2018?

  2) ¬øCu√°l es el efecto de **sexo** sobre la probabilidad de asistencia a museos de arte contempor√°neo en 2018?

# A.- Lineal Probability Model (LPM)

-  Lectura de coeficientes:

1) Efecto de Edad sobre la probabilidad de asistencia a museos de arte contempor√°neo en 2018.

--

R= En promedio, por cada a√±o m√°s de edad de los individuos *i* la probabilidad de asistir a museos de arte disminuye 0.001, o en otras palabras disminuye en 0.1% controlando por las covariables del modelo. Este es un efecto significativo al 99,9% de confianza `\(p=3.89e-09\)`

--

2) Efecto de Sexo sobre la probabilidad de asistencia a museos de arte contempor√°neo en 2018.

--

R= En promedio, el ser mujer en comparaci√≥n con ser hombre aumenta la probabilidad de asistir a museos de arte en 0.043, o en otras palabras aumenta en 4.3% controlando por las covariables del modelo. Este es un efecto significativo al 99,9% de confianza `\(p=2.49e-06\)`

--

3) Efecto de Raza sobre la probabilidad de asistencia a museos de arte contempor√°neo en 2018.

--

R= En promedio, el pertenecer a una raza no-blanca en comparaci√≥n con blanco disminuye la probabilidad de asistir a museos de arte en 0.057, o en otras palabras disminuye en 5.7% controlando por las covariables del modelo. Este es un efecto significativo al 99,9% de confianza `\(p=3.47e-06\)`

# B.- Regresi√≥n Log√≠stica (GLM)

**1- Ajuste un modelo de regresi√≥n log√≠stica que predice la asistencia a museos como funci√≥n del sexo, la raza y la edad de los encuestados.** 

Formalmente:


&lt;br&gt;
`$$\underbrace{\ln \frac{p_{i}}{ 1 - p_{i}}}_{\text{logit}(p_{i})}    = \beta_{0} + \beta_{1}\text{mujer}_{i} + \beta_{2}\text{no blanque}_{i} + \beta_{3}\text{edad}_{i}$$`
&lt;br&gt;

donde:

- `\(p_{i} =\mathbb{P}(\text{asisitir museos}_{i}=1)\)`

- `\(\text{logit}(p_{i})\)` es el .bold[log odds] de tener asistir al museo.

- `\(p_{i}\)` y `\(\text{logit}(p_{i})\)` son una funci√≥n de sexo (mujer), raza (no blanque) y edad (a√±os).

---

# B.- Regresi√≥n Log√≠stica (GLM)

**Respuesta**:


```r
#Estimaci√≥n de GLM (Regresi√≥n log√≠stica)
rl1 &lt;- glm(1*museos_b ~ sexo_b + raza_b + edad, family = binomial(link=logit), data=data1)
summary(rl1)
```
